import React from "react";

function Footer() {
  return (
    <footer className="footer footer-default">
      <div className="container">
        <div className="copyright float-right">
          &copy; 2020 , made with <i className="material-icons">favorite</i> for
          <a href="https://www.uxbertcom/" target="_blank">
            UXBERT
          </a>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
